result:
.wrapper {
    height: 20rem;
}

.alert-wrapper {
    height: 21rem;
}

.bgBlue {
    background-color: rgba(9, 25, 37, .2);
    height: 100%;
}

.bgYellow {
    background-color: rgba(32, 99, 155, .5);
}

ul > li { 
    /* margin-top: .35rem; */
    /* height: 50px; */
    padding-left: 45px;
    font-weight: 700;
    background-repeat: no-repeat;
    margin-top: 1rem;
    background-image: url('/img/icons/favicon-32x32.png');
}

.lineHeight {
    line-height: 32px;
}

.lineHeightAlert {
    line-height: 35px;
}

.imgWrapper {
   background-repeat: no-repeat;
   background-size: cover;
   background-position: center; 
   height: 25rem;
   overflow: hidden;
   background-image: linear-gradient(rgba(0, 0, 0, .25), rgba(0, 0, 0, .25)), url('/img/icons/watcheshomecardbg.jpg');           
}

#titleCard {
    position: absolute;
    margin-top: 6rem;
}

input {
    border: none;
    border-bottom: 2px solid gray;
    outline: none;
}

#watch-collection {
    /* background: rgba(40,40,40,.2   ); */
    overflow-y: scroll;
}

.outline {
    -webkit-text-stroke: 1px black;
}

#brandLogo {
    max-height: 75px;
}

.form-control:focus {
    border: none;
    outline: none !important;
}

.card {
    box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
}

@media(max-width: 995px){
    .rowContainer {
        height: 100%;
    }

    .card {
        border: none;
        border-radius: 0;
    }

    #titleCard {
        margin-top: 5rem;
    }

    .imgWrapper {
        height: 24rem;
    }

    .wrapper {
        height: 19.375rem;
    }

    .alert-wrapper {
        height: 20.5rem;
    }
}

@media(max-width: 765px){
    .card, .card-img {
        box-shadow: none;
        border: none;
        border-radius: 0;
    }

    #titleCard {
        margin-top: 5rem;
    }

    .imgWrapper {
        height: 20rem;
    }

    .wrapper {
        height: 18.9rem;
    }

    .alert-wrapper {
    height: 21.25rem;
    }
}
